import React from "react";
import { useState } from "react";
import "./popup.css";

function POPUP(props) {
    const[enabled,setEnabled]=useState(true);
    const handleEventClick=()=>{
        setEnabled(false);
    }
  return (
    <div className={enabled?"popup":"popup active"}>
      <div className="title">Success!!</div>
      <div className="description">Hello every one. I am Jinson V Shaju.</div>
      <div className="dismiss-btn">
        <button className="dismiss-popup-btn" onClick={handleEventClick}>Dismiss</button>
      </div>
    </div>
  );
}

export default POPUP;
